// 地图
{
	var _Width = 430;
	var _Height = 457;
	var _Parent = d3.select('#map');
	var _SVG = null;
	var _ShowPoints = true;
	var _Decimal = 1000;
	var _show = "none";

	try {
		d3.select('#map').style("padding","0px");
		_SVG = _Parent.append("svg").attr("id","map-container").attr("width",_Width).attr("height",_Height).style("border","1px solid black");
	} catch(error) {
		console.log("ERROR: Unable to get the parent node.");
	}
	try {
		var pattern1 = _SVG.append("defs").append("pattern").attr("id","background-image1").attr("width",1).attr("height",1).attr("patternUnits","objectBoundingBox");
		pattern1.append("image").attr("xlink:href","./images/all.png").attr("width",_Width).attr("height",_Height);
		var pattern2 = _SVG.append("defs").append("pattern").attr("id","background-image2").attr("width",1).attr("height",1).attr("patternUnits","objectBoundingBox");
		pattern2.append("image").attr("xlink:href","./images/getons.png").attr("width",_Width).attr("height",_Height);
		var pattern3 = _SVG.append("defs").append("pattern").attr("id","background-image3").attr("width",1).attr("height",1).attr("patternUnits","objectBoundingBox");
		pattern3.append("image").attr("xlink:href","./images/getoffs.png").attr("width",_Width).attr("height",_Height);
		var pattern4 = _SVG.append("defs").append("pattern").attr("id","background-image4").attr("width",1).attr("height",1).attr("patternUnits","objectBoundingBox");
		pattern4.append("image").attr("xlink:href","./images/chengdu.png").attr("width",_Width).attr("height",_Height);
	} catch(error) {
		console.log("ERROR: Unable to load the image.");
	}
	try {
		var _chart = _SVG.append("rect").attr("id","background").attr("width",_Width).attr("height",_Height).attr("x",0).attr("y",0).style("fill","url(#background-image4)");
	} catch(error) {
		console.log("ERROR: Unable to load the image.");
	}

	d3.select("#chart1").append("div")
					.html('<button type="button" class="btn btn-default" id="getons" style="float: left; margin: 42px 58px; background: #FFFFFF;">上车坐标</button>\
							<button type="button" class="btn btn-default" id="getoffs" style="float: left; margin: 42px 58px; background: #FFFFFF;">下车坐标</button>');

	d3.select("#getons").on("click",function() {
		switch (_show) {
			case "all":
				_show = "getoffs";
				_chart.style("fill","url(#background-image3)");
				d3.select(this).style("background","#FFFFFF");
				break;
			case "getoffs":
				_show = "all";
				_chart.style("fill","url(#background-image1)");
				d3.select(this).style("background","#428BCA");
				break;
			case "getons":
				_show = "none";
				_chart.style("fill","url(#background-image4)");
				d3.select(this).style("background","#FFFFFF");
				break;
			case "none":
				_show = "getons";
				_chart.style("fill","url(#background-image2)");
				d3.select(this).style("background","#428BCA");
				break;
		}
	});
	d3.select("#getoffs").on("click",function() {
		switch (_show) {
			case "all":
				_show = "getons";
				_chart.style("fill","url(#background-image2)");
				d3.select(this).style("background","#FFFFFF");
				break;
			case "getons":
				_show = "all";
				_chart.style("fill","url(#background-image1)");
				d3.select(this).style("background","#428BCA");
				break;
			case "getoffs":
				_show = "none";
				_chart.style("fill","url(#background-image4)");
				d3.select(this).style("background","#FFFFFF");
				break;
			case "none":
				_show = "getoffs";
				_chart.style("fill","url(#background-image3)");
				d3.select(this).style("background","#428BCA");
				break;
		}
	});
}

