	var force = d3.layout.force()
				.nodes(nodes)
				.links(edges)
				.size([500,500])
				.linkDistance(100)
				.charge(-100);

	force.start();

	// console.log(nodes);
	// console.log(edges);

	var colorTable = d3.scale.category20();

	var lines = svgForce.selectAll(".forceLine")
					.data(edges)
					.enter()
					.append("line")
					.attr("id",function(d,i) {
						return "L"+i;
					})
					.attr("transform","translate(10,30)")
					.attr("class","forceLine")
					.style("stroke","rgba(66,139,202,0.2)");

	var circles = svgForce.selectAll(".forceCircle")
					.data(nodes)
					.enter()
					.append("circle")
					.attr("transform","translate(10,30)")
					.attr("class","forceCircle")
					.attr("r",6)
					.style("fill",function(d,i) {
						return colorTable(i);
					})
					.style("stroke","1px solid black")
					.call(force.drag);

	var texts = svgForce.selectAll(".forceText")
					.data(nodes)
					.enter()
					.append("text")
					.attr("class","forceText")
					.attr("transform","translate(10,30)")
					.attr("x",function(d) { return d.x; })
					.attr("y",function(d) { return d.y; })
					.attr("dy",".1em")
					.attr("font-size",6)
					.text(function(d) { return d.name; });

	force.on("tick", function() {
		lines.attr("x1",function(d){ return d.source.x; });
		lines.attr("y1",function(d){ return d.source.y; });
		lines.attr("x2",function(d){ return d.target.x; });
		lines.attr("y2",function(d){ return d.target.y; });

		circles.attr("cx",function(d) { return d.x; });
		circles.attr("cy",function(d) { return d.y; });

		texts.attr("x",function(d) { return d.x; });
		texts.attr("y",function(d) { return d.y; });
	});

	force.on("start", function() {
		//console.log("运动开始");
	});
	force.on("end", function() {
		//console.log("运动结束");
	});
